import React, { useState, useEffect } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Header from "../components/Header";
import { useNavigate } from 'react-router-dom';
import { BASE_URL } from '../fetchApi';

const QuizStart = () => {
    const base_url = BASE_URL;
    const [opponent, setOpponent] = useState("");
    const [time, setTime] = useState(0);

    const navigate = useNavigate();
    useEffect(() => {
        const token = sessionStorage.getItem('token');
        if (!token) {
            navigate('/login');
        }
    }, [navigate]);

    const handleStartQuiz = async (e) => {
        e.preventDefault();
        // Must fill required
        if (!opponent || time <= 0) {
            alert("Please select an opponent and set a valid time.");
            return;
        }
        //navigate("/quizpage", { state: { opponent, time } });

        const data ={
            mode: opponent,
            user_id: sessionStorage.getItem('user_id'),
            opponent_id: null,
            timerDuration: time,
        };

        try {
            const response = await fetch(`${base_url}/quiz/start `, {
                method: "POST",
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(data),
            });
    
            if (!response.ok) {
                throw new Error(`Error: ${response.statusText}`);
            }
    
            const result = await response.json();
            //console.log(result);
            // const msg = result.msg;
            // const quizId = result.quizId;
            // const mode = result.mode;
            // const question_list = Array.isArray(result.question) ? result.question : [];
            // const timerDuration = result.timerDuration;
            navigate("/quizpage", { state: result });
        } catch (error) {
            
        }
    };

    return (
    <div className="container-fluid d-flex flex-column min-vh-100 px-0">
        {/* Header: Vollbreit + Fixes Layout */}
        <Header />
        
        {/* Hauptinhalt */}
        
        <main className="d-flex flex-column align-items-center flex-grow-1 mt-5">
        {/* Timer rechts oberhalb des Quiz-Kastens */}
        <div className="d-flex justify-content-end w-50 mb-2">
            <span className="badge bg-info fs-5">Welcome, to start quiz fill the form below!</span>
        </div>

        <div className="card p-4 shadow-sm" style={{ width: "50%" }}>
            <div className="card-header bg-light">Quiz Start</div>
            <div className="card-body">
                <p>Choose your opponents?</p>
                <form>
                    <div className="form-check">
                        <input 
                            className="form-check-input" 
                            type="radio" 
                            name="opponent" 
                            id="opponent1" 
                            value={"computer"}
                            onChange={(e) => setOpponent(e.target.value)} 
                        />
                        <label className="form-check-label" htmlFor="opponent1">VS Computer</label>
                    </div>
                    <div className="form-check">
                        <input 
                            className="form-check-input" 
                            type="radio" 
                            name="opponent" 
                            id="opponent2"
                            value={"1v1"} 
                            onChange={(e) => setOpponent(e.target.value)} 
                        />
                        <label className="form-check-label" htmlFor="opponent2">1 VS 1</label>
                    </div>
                </form>
                <br></br>
                <p>Fill the time</p>
                <form>
                    <div className="form-check">
                        <input className="form-control" type="number" name="time" id="time" min={1} onChange={(e) => setTime(e.target.value)} />
                    </div>
                </form>
            </div>
        </div>
        
        {/* Navigationslinks und Button außerhalb des Frage-Kastens */}
        <div className="d-flex justify-content-between w-50 mt-3">
            <div>&nbsp;</div>
            <button className="btn btn-primary" onClick={handleStartQuiz}>Start</button>
        </div>
        </main>
    </div>
    );
};

export default QuizStart;
